import React from "react";
import { AiFillWechat } from "react-icons/ai";

export default function Logo() {
    return(
        <IconContext.Provider value={{ className: "logo", size: 35 }}>
        <>
            <AiFillWechat/>
        </>
        </IconContext.Provider>
    )
}
